('9789984234939', 14, 'Debesu iekarotājs. Mana dzīve brīvajā kritienā', 'Ekstrema sporta lielmeistars, 4 pasaules rekordu ipasnieks Felikss Baumgartners (1969) saja gramata stasta par savu dzives celu no automehanika macekla lidz lecienam no stratosferas. Par saviem elpu aizraujosajiem lecieniem no visneiedomajamakajam vietam – no 452 metrus augstajiem Petronas Dvinu torniem Malaizija, no Jezus statujas Riodezaneiro, par lecienu Mameta ala Horvatija un daudziem citiem, kas 2012. gada 14. oktobri vainagojas ar pasaules rekordu brivaja kritiena – lecienu no stratosferas 39 kilometru augstuma, parvarot skanas barjeru. Stastijumu papildina fotografijas un citas interesantas liecibas par sportista dzivi, treniniem un iespaidigakajiem sasniegumiem. No vacu valodas tulkojusi Inga Rozentale. Artas Ozolas-Jaunarajas makslinieciskais noformejums.', 'Biografijas', 191, , '2015', 'Latviesu', 'cietie vaki', 4.50, 24);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789984812932', 3, 'Atbalsis. Raksti un vēstules Eiropā 1921-1946', 'Lieliskais latviesu tenors un spozais memuarists Mariss Vetra (1901–1965) sava muza ir sarakstijis tiesam daudz. Dazados preses izdevumos 40 gadu laika publiceti vairak neka tukstos rakstu. Saja krajuma pirmo reizi apkopoti musu Nacionalas operas un citu Eiropas operteatru solista un valdzinoso atminu stastu autora raksti prese, ka ari vestules latviesu kulturas darbiniekiem un draugiem, kas glabajas Latvijas muzejos, arhivos un privatos krajumos. Teksti sakartoti divos sejumos: Eiropa (1921–1946) un Kanada (1947–1965), kas atbilst ari Marisa Vetras dzives dalijumam.', 'Biografijas', 450, , '2011', 'Latviesu', 'Miksts', 15.64, 100),
('9789984824284', 5, 'Araisu ezerpils', 'Rakstu izlase un draugu atminas. Gramata atradisiet informaciju par Araisu ezerpils vesturi un tas arheologisko izpeti, ka ari citam ezeru pilim Latvija. Jana Apala un Araisu ezerpils vardi nav skirami, tie tikai papildina viens otru. Pateicoties J.Apalam, atdzima Araisu ezerpils, bet savukart pati ezerpils padarija vinu par pazistamako un popularako arheologu Latvija un tautas apzina par legendaru viru, kurs macejis no ezera dzelmes gaisma celt teikam apvito, sendienas nogrimuso senlatvju pili. Maksliniece Inara Jegere.', 'Latvijas vesture', 639, , '2012', 'Latviesu', 'Ciets', 12.79, 56),
('9789984847894', 1, '1991 - tas garais cilvekberna gads', 'Musu kinorezisora un briniskiga rakstnieka, sava laika dokumentetaja Jana Streica gramata — loti apjomigs un saturiski augstu vertejams darbs ne tikai par Latvijai un ipasi Latgalei tik svarigo filmu, bet ari par Latvijas vesture smagu un nozimigu laiku — 1990.-1992. gadu, kas skaudri un godigi atspogulojas Jana Streica ta laika dienasgramatas un sarakste ar rakstnieku Jani Klidzeju.', 'Romani', 670, , '2008', 'Latviesu', 'Ciets', 10.99, 49);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789984869452', 4, 'Aizliegta ticiba', 'Ricards Smolijs ir pasaule zinama autoritate misticisma un ezoterisko zinasanu jautajumos. Izglitojies klasiskaja literatura un filozofija Harvarda universitate un Oksfordas Universitate, vins ir vadijis vairakus religiska satura zurnalus, lasijis plasi apmekletas lekcijas un sarakstijis piecas gramatas.', 'Religija', 453, , '2010', 'Latviesu', 'Miksts', 3.62, 26);

